import React from 'react';

class Customer extends React.Component {
    render () {
        return (
            <div>
                <h2>홍길동</h2>
                <p>961222</p>
                <p>남자</p>
                <p>대학생</p>
            </div>
        )
        
    }
}

export default Customer;
